#include <iomanip>
#include <cstdio>
#include <cmath>
#include <cstdlib>
#include <ctime>
 
using namespace std;
typedef long long ll;
typedef long double ld;
 
class DengklekMessage {
public:
  int G, P, Plen[50];
  int matchLen[50][50][500];
  ld p[501][501];
  ld prob(int i, int k)
  {
    if (i >= G)
      return 1;
    else if (k <= 0)
      return 0;
    if (k > 500)
      k = 500;
    ld& res = p[i][k];
    if (res != -1) return res;
    res = 0;
    for (int p = 0; p < P; ++p)
    {
      int m = matchLen[p][0][i];
      if (m >= min(G-i, Plen[p]))
        res += prob(i+m, k-1);
    }
    res /= P;
    return res;
  }
  double theExpected(vector <string> pieces, vector <string> goodSubstring, ll K) {
    for (int i = 0; i <= 500; ++i)
    for (int j = 0; j <= 500; ++j)
      p[i][j] = -1;
    string good = "";
    for (int i = 0; i < goodSubstring.size(); ++i)
      good += goodSubstring[i];
    G = good.length();
    P = pieces.size();
    for (int p = 0; p < P; ++p)
      Plen[p] = pieces[p].length();
    
    for (int p = 0; p < P; ++p)
    for (int i = 0; i < Plen[p]; ++i)
    for (int j = 0; j < G; ++j)
    {
      matchLen[p][i][j] = 0;
      int k = 0;
      while (i+k < Plen[p] && j+k < G && pieces[p][i+k] == good[j+k])
      {
        k++;
        matchLen[p][i][j]++;
      }
    }
    
    ld res = 0;
    int smallK = 500;
    if (K < smallK) smallK = K;
    
    for (int p = 0; p < P; ++p)
    for (int i = 0; i < Plen[p]; ++i)
    {
      int m = matchLen[p][i][0];
      if (m >= min(G, Plen[p] - i))
      {
        res += prob(m, 500);
      }
    }
    res *= K - smallK;
    for (int k = 0; k < smallK; ++k)
    {
      for (int p = 0; p < P; ++p)
      for (int i = 0; i < Plen[p]; ++i)
      {
        int m = matchLen[p][i][0];
        if (m >= min(G, Plen[p] - i))
        {
          res += prob(m, k);
        }
      }
    }
    res /= P;
    return res;
  }
};
 
 
 
